import React from 'react';
import Navbar from './components/Navbar'; // Đảm bảo Navbar.js có trong components
import Map from './components/Map';
import 'leaflet/dist/leaflet.css';

const App = () => {
  return (
    <div>
      <Navbar />
      <h1>Find Our Cars</h1>
      <Map />
    </div>
  );
};

export default App;
